import React from 'react';
import { TrendingUp, Shield, PieChart, DollarSign, BookOpen, Check } from 'lucide-react';

// Custom Card Component
const Card = ({ children, className = '' }) => (
  <div className={`bg-white rounded-lg shadow-md ${className}`}>
    {children}
  </div>
);

const InvestmentBasics = () => {
  const sections = [
    {
      title: "What is Investing?",
      content: "Investing means putting money into assets with the goal of growing wealth over time. Think of it as planting seeds today to grow a financial garden for tomorrow.",
      icon: <TrendingUp className="w-8 h-8 text-blue-500" />,
    },
    {
      title: "Key Investment Types",
      content: "Stocks (ownership in companies), Bonds (lending money to organizations), Mutual Funds (professionally managed investment pools), and Real Estate are common investment vehicles.",
      icon: <PieChart className="w-8 h-8 text-green-500" />,
    },
    {
      title: "Risk and Return",
      content: "Higher potential returns typically come with higher risks. Diversification - spreading investments across different assets - helps manage risk.",
      icon: <Shield className="w-8 h-8 text-purple-500" />,
    }
  ];

  const tips = [
    "Start early to benefit from compound interest",
    "Never invest more than you can afford to lose",
    "Research before investing",
    "Consider your risk tolerance",
    "Diversify your portfolio"
  ];

  return (
    <div className="max-w-4xl mx-auto p-6 space-y-8">
      {/* Hero Section */}
      Hlo
      <div className="text-center mb-12">
        <h1 className="text-4xl font-bold text-gray-800 mb-4">
          Investment Basics 101
        </h1>
        <p className="text-xl text-gray-600">
          Your journey to financial growth starts here
        </p>
      </div>

      {/* Main Content Cards */}
      <div className="grid md:grid-cols-3 gap-6">
        {sections.map((section, index) => (
          <Card key={index} className="hover:shadow-lg transition-shadow duration-300">
            <div className="p-6">
              <div className="flex flex-col items-center text-center space-y-4">
                {section.icon}
                <h2 className="text-xl font-semibold text-gray-800">
                  {section.title}
                </h2>
                <p className="text-gray-600">
                  {section.content}
                </p>
              </div>
            </div>
          </Card>
        ))}
      </div>

      {/* Investment Tips Section */}
      <Card className="mt-8">
        <div className="p-6">
          <div className="flex items-center mb-4">
            <BookOpen className="w-6 h-6 text-blue-500 mr-2" />
            <h2 className="text-2xl font-semibold text-gray-800">
              Essential Investment Tips
            </h2>
          </div>
          <div className="grid md:grid-cols-2 gap-4">
            {tips.map((tip, index) => (
              <div key={index} className="flex items-center space-x-2">
                <Check className="w-5 h-5 text-green-500 flex-shrink-0" />
                <p className="text-gray-700">{tip}</p>
              </div>
            ))}
          </div>
        </div>
      </Card>

      {/* Getting Started Section */}
      <Card className="bg-gradient-to-r from-blue-500 to-purple-500 text-white">
        <div className="p-6">
          <div className="flex items-center justify-between">
            <div>
              <h2 className="text-2xl font-bold mb-2">
                Ready to Start Investing?
              </h2>
              <p className="mb-4">
                Begin with small, regular investments and learn as you grow.
              </p>
            </div>
            <DollarSign className="w-12 h-12" />
          </div>
        </div>
      </Card>

      {/* Educational Resources */}
      <div className="text-center p-6 bg-gray-50 rounded-lg">
        <h3 className="text-xl font-semibold text-gray-800 mb-4">
          Continue Learning
        </h3>
        <p className="text-gray-600">
          Remember: This is just the beginning. Keep learning through books, 
          reliable financial websites, and consider consulting with financial advisors 
          for personalized guidance.
        </p>
      </div>
    </div>
  );
};

export default InvestmentBasics;
